def data
  @data ||= DATA.read.split("\n").map { |row| row.chars }
end

def search(x:, y:)
  count = 0
  return count if data.dig(y, x) != "A" ||
    (x - 1).negative? ||
    (y - 1).negative? ||
    (x + 1) > data.size ||
    (y + 1) > data.first.size

  poses = [].tap do |pose|
    pose << data.dig(y - 1, x - 1)
    pose << data.dig(y - 1, x + 1)
    pose << data.dig(y + 1, x - 1)
    pose << data.dig(y + 1, x + 1)
  end

  if data.dig(y - 1, x - 1) != data.dig(y + 1, x + 1) &&
      poses.count { |p| p == "S" } == 2 &&
      poses.count { |p| p == "M" } == 2
    count += 1
  end
  count
end

def locate(x:, y:, char:)
  data.dig(y, x) == char
end

counter = 0
data.each_with_index do |row, y|
  row.each_with_index do |_cell, x|
    counter += search(x: x, y: y)
  end
end

puts counter

